import React from "react";

import "../Projects/Projects.css";

import LookingForMaecenas from "../../images/LookingForMaecenas.png";

const Card = (props) => {
  const handleClick = () => {};
  const holdTempClass = "cardBox border-0 ";
  return (
    <div className={holdTempClass + props.name}>
      <div className="content rounded">
        <div className="front rounded">
          <div
            className="frontCard rounded"
            style={{
              backgroundImage: `url(${LookingForMaecenas})`,
              backgroundPosition: "center",
              backgroundRepeat: "no-repeat",
              backgroundSize: "cover",
            }}
          ></div>
        </div>
        <div className="back rounded d-flex justify-content-center align-content-center">
          <div>
            <button type="button" class="btn btn-primary">
              Primary
            </button>
            <button type="button" class="btn btn-secondary">
              Secondary
            </button>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Card;
